import React, {Component, Fragment} from 'react';
import NavBar from '../Nav';
import {Button, Card} from 'semantic-ui-react'
import {Link} from 'react-router-dom'

function PlantList(props){
    // console.log(props.companions)
    const plants = props.searchedPlant.map((searchedPlant) => {
        return(
            <Card key={searchedPlant.id}>
                <Card.Header>{searchedPlant.common_name}</Card.Header>
                <Card.Content>
                    <Card.Description>{searchedPlant.scientific_name}</Card.Description>
                    <Card.Description>{searchedPlant.family_common_name}</Card.Description>
                </Card.Content>
            </Card>
        )
    })
    return(
        <Card.Group cenered='true'>
            {plants}
        </Card.Group>
    )
}

export default PlantList
